$.ajax('http://agar.io/agario.core.js', {
    success: core => {
        core = core.replace(/(([\w]\s*=\s*\+?[\w]\[[0-9]+\]\s*\<\s*)(.4))/, "$20");
        core = core.replace(/([\w]+\s*=\s*[\w]+\s*\+\s*16\s*\|\s*0;\s*([\w=]+)\s*=\s*\+[\w\[\s*><\]]+;)/, '$1 $2*=0.70;');
        eval(core);
    },
    dataType: 'text',
    method: 'GET',
    cache: false,
    crossDomain: true
});
